from os.path import expanduser  # Common pathname manipulations

from t_system.face_encoding import FaceEncodeManager, FaceEncoder, Face

import os  # Miscellaneous operating system interfaces
import pytest


home = expanduser("~")
dot_t_system_dir = f'{home}/.t_system'

recognition_folder = f'{dot_t_system_dir}/recognition'

if os.path.exists(f'{dot_t_system_dir}/db.json'):
    os.remove(f'{dot_t_system_dir}/db.json')  # This is where we store the database; /home/USERNAME/.t_system/recognition/db.json


@pytest.fixture
def face_encode_manager():
    """Returns a :class:`t_system.face_encoding.FaceEncodeManager` instance."""

    return FaceEncodeManager("hog")


@pytest.fixture
def face_encoder():
    """Returns a :class:`t_system.face_encoding.FaceEncoder` instance."""

    return FaceEncoder("hog")


@pytest.fixture
def face():
    """Returns a :class:`t_system.face_encoding.Face` instance."""

    return Face("Cem Baybars GÜÇLÜ")


invalid_photo = {"name": "photo_invalid.jpeg", "base_sf": "invalid_encode"}
valid_photo = {"name": "photo_valid.jpeg", "base_sf": ""}


def test_create_dataset_from_base_sf_photos(face):
    face.create_dataset_from_base_sf_photos([valid_photo])
    assert "photo1.jpeg" in face.image_names


def test_create_dataset_from_base_sf_photos_raises_exception_on_insufficient_amount(face):
    with pytest.raises(Exception):
        face.create_dataset_from_base_sf_photos([invalid_photo])


def test_delete_images(face):
    face.delete_images([valid_photo["name"]])


